it amet, consectetur adipiscing elit. Morbi ac tristique magna. Proin pulvinar augue nulla, eu efficitur eros accumsan ac. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Donec ornare vel eros et pharetra. Praesent placerat, velit id viverra pretium, ligula odio maximus nulla, at bibendum tortor lacus eu risus. Proin id sollicitudin tellus. Vestibulum ornare fringilla arcu nec bibendum.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,'2017-06-16 11:06:35',4,1,1,NULL,1,NULL,7,NULL,'Hui Jing is a self-taught designer and developer based in Singapore. Reducing lines of code in her web projects makes her extremely happy. She used to play basketball full-time and launched her web career during downtime between training sessions. \r\n\r\nRussell Vergara – Branding \r\nHe sold his first PUTO when he was six. He worked as a waiter for Burgoo, and as an In-room dining assistant at Sheraton Park Hotel. In London. He’s an only child, so he’s kinda spoiled. He was 80 pounds lighter, nung hindi pa uso ang extra rice. He studied 7 courses 7 different schools. But he never graduated. He’s not very bright kasi. But he’s very madiskarte. He’s Russell. The Big Daddy of Vigi.\r\n\r\nAceler Chua — Typography\r\nAceler grew up in Hong Kong; spent past seven years in the Philippines, Aceler recently moved back to Hong Kong to continue his design and web development journey. At Grayscale, he uses his front end development and typography chops to establish better visual structure for websites. During off hours, he spends most of his time improving his typography skills while looking for great food.\r\n\r\nAngela Obias-Tuban & B Tuban – Product Design workshop\r\nAngela & B are co-founders of Priority Studios. Angela is also a teacher at the Ateneo De Manila University for User Experience Design, and a product design mentor for startup incubator IdeaSpace. B is an Interaction Designer by profession and industrial designer by degree and oversees collaboration, business, and strategy.\r\n\r\nJohn Paul De Guzman – Business of Design workshop\r\nJP de Guzman is the Founder and Chief Creative of Frost Design and Consulting Group a Manila-based design agency. He is an Entrepreneur, Designer, Developer, Curious Folk, Teacher, and Industry advocate.\r\n\r\nChris Lienert – Javascript Applications workshop\r\nChris started out as a web developer when Netscape ruled the world and is currently an engineering manager at CXA Group in Singapore. He has written for Net Magazine and SitePoint, and founded community group Singapore CSS because someone had to. Aside from musical distractions and accumulating frequent flyer points, Chris and his wife Sarah can be found in the company of their small human.\r\n',NULL,NULL,'2017-06-21','2017-06-21',NULL,NULL,NULL,NULL,NULL),(13,'2017-06-16 01:36:50',4,1,1,NULL,2,NULL,7,NULL,'asdfsdf',NULL,NULL,'2017-06-20','2017-06-20',NULL,NULL,NULL,NULL,NULL),(14,'2017-06-16 01:39:44',4,1,1,NULL,1,NULL,2,NULL,'It’s time to master your time, Anil!\r\n\r\nWith modern advances and information becoming increasingly available to us, we live in a world that grants us more opportunities and possibilities than ever before. People are living longer, education levels are higher, and global reach is wider.\r\n\r\nBut all these choices can be overwhelming. The explosive growth of information, technology, and competition has made change nearly impossible to keep up with. Having more means being pressured to do more in less time. So many things demand your attention, your responsibilities and obligations pile up, and you end up feeling like there isn’t enough time in the day.\r\n\r\nPerhaps you manage to get everything done, but it’s not quite the way you hoped, and it’s at the expense of feeling burned out from the demands of your job, personal life, and everything else in the world.\r\n\r\nThere is a way out of this time loop…\r\n\r\nYou need to look at time differently.\r\n\r\nI’ve discovered that there are different types of time for different times in your life. Each activity and responsibility in your life requires you to take a different approach to time if you want to get the best results from everything you do.\r\n\r\nI have gathered my discoveries and expertise on time management into my book, “Master Your Time, Master Your Life.” And so you can see exactly what I’m talking about, I’ve included the Introduction and first chapter FREE in this email!\r\n\r\nMaster Your Time, Master Your Life\r\nYou can access the Intro and Chapter 1 for FREE by clicking here.\r\n\r\nInside you\'ll discover:\r\n\r\nHow your mastery of time completely determines your quality of life\r\nThe importance of \"stop and think\" behavior, and how to make it a habit\r\nThe first step in planning how to achieve the things you really want in life\r\nHow to implement the same success habits of the top 3% of performers\r\nIf you want to break free from this cycle of not having enough time, give this book a quick look and you’ll start to see how you can manipulate time to your advantage.\r\n\r\nDownload your FREE sneak peek of Master Your Time, Master Your Life here\r\n\r\nTo mastering your time,\r\n\r\nBrian Tracy\r\n\r\nBrian Tracy\r\n\r\n ',NULL,NULL,'2017-06-20','2017-06-20',NULL,NULL,NULL,NULL,NULL),(15,'2017-06-16 02:19:18',4,1,1,NULL,2,NULL,2,NULL,'THIS IS SAMPLE ONLY PLEASE IGNORE.',NULL,NULL,'2017-04-01','2017-06-27',NULL,NULL,NULL,NULL,NULL),(16,'2017-06-16 03:42:29',4,2,1,NULL,2,NULL,2,NULL,'sample only\r\nasdf\r\nas\r\ndf\r\nsa\r\ndf\r\nasd\r\nf\r\nasdf',NULL,NULL,'1970-01-01','1970-01-01',NULL,NULL,NULL,NULL,NULL),(17,'2017-06-16 04:00:27',4,1,1,NULL,10,NULL,7,NULL,'asjdlkfjpoexrwuxeuieurqiorwnuqieruiqwuyxirywquiyeriuywqiuryeuiwy',NULL,NULL,'1970-01-01','1970-01-01','1970-01-01',NULL,NULL,NULL,NULL),(18,'2017-06-16 04:01:44',4,1,1,NULL,1,NULL,1,NULL,'asfdasdfasfasdfasdfasdfasdf',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(19,'2017-06-16 16:03:18',4,2,3,NULL,5,NULL,1,NULL,'